import { NavLink, Link } from "react-router-dom";

export default function NavBar() {
  return (
    <>
      {/* <h1>Navbar Goes Here</h1> */}
      <nav>
        <NavLink to="/">About</NavLink>

        <NavLink to="/Ben">Ben</NavLink>

        <NavLink to="/Elliot">Elliot</NavLink>
      </nav>
    </>
  );
}
